import posts from "./posts.json";

const PostSummaryList = ({title}) => {

            return (
            <ul className="list-group">
                {title && 
                    posts.map(post => {
                        return (<PostSummaryItem post = {post}/>);
                    })
                }       
            </ul>

        );
}
export default PostSummaryList;
